import React from "react";
import Search from "./Search";
import Map from "./Map";
import Video from "./Video";
import Sns from "./Sns";
import styled from "styled-components"
import '/assets/css/Main.css';
class Main extends React.Component{
    render(){
        return(
         <div className="Main"> 
            <div className="Search">
             <Search/>
            </div>
             <Map/>
             <Video/>
            <Sns/>
         </div>
        );
    }
}

export default Main;
